  true,\n\t\"url\": null,\n\t\"notes\": \"NAIP imagery is acquired annually with the
  total coverage being determined by available funds from FSA and funding partners,
  considering FSA priorities. The NAIP acquires digital ortho imagery during the agricultural
  growing seasons in the contiguous U.S (lower 48 states). The NAIP provides 1-meter
  or 60cm ground sample distance (GSD) ortho imagery or optional (with partner buy-up)
  1/2-meter GSD ortho imagery, with a horizontal accuracy of +/- 4 meters to true
  ground. The data deliverables consist of DOQQ tiles and Compressed County Mosaics
  formatted to the UTM coordinate system using the North American Datum of 1983 (NAD83).
  The NAIP imagery may contain as much as 10% cloud cover per tile. NAIP imagery is
  generally acquired in projects covering full states, and is typically available
  for distribution within 60 days of the end of a flying season. It is intended to
  provide current information of agricultural conditions in support of USDA farm programs.
  It is also used by federal cost share partners to meet their mission needs. The
  2017 - 2018 Planned Acquisition Map shown here may change depending on funding.
  For more information about possibly becoming a NAIP funding partner, please contact
  APFO, Bridget Barlow at bridget.barlow@slc.usda.gov\",\n\t\"license_title\": \"Creative
